define("Core/helpers/Date/getCurrentPeriod",["Core/helpers/Date/periodTypes"],function(r){return function(e){var t=new Date;if(e===r.month)return[new Date(t.getFullYear(),t.getMonth(),1),new Date(t.getFullYear(),t.getMonth()+1,0)];else if("quarter"===e)return[new Date(t.getFullYear(),3*(t.getMonth()/3|0),1),new Date(t.getFullYear(),3*(t.getMonth()/3|0)+3,0)];else if("halfyear"===e)return[new Date(t.getFullYear(),6*(t.getMonth()/6|0),1),new Date(t.getFullYear(),6*(t.getMonth()/6|0)+6,0)];else if("year"===e)return[new Date(t.getFullYear(),0,1),new Date(t.getFullYear(),11,31)]}});